- input: "TEXT\x1CC00004036\x1CX0\x1C\x1CF3XN\x1CPlease note that the Committee's
    software vendor calculates the calendar-year-to-date per election totals somewhat
    differently than the FEC's reporting software calculates these expenditures. Rather
    than immediately count the independent expenditures that are first disclosed as
    memo entries, as the FEC's software does, the Committee's software does not add
    the cost of an independent expenditure to the calendar-year-to-date per election
    for office sought total until the independent expenditure is actually paid. Accordingly,
    only when the committee discloses payment of the independent expenditures, will
    our totals match the Commission's totals.\n"
